  const handleChange = (event: ChangeEvent<HTMLInputElement>) => {
    setHabit(event.target.value)
    return;
  }

  const handleSubmit = () => {
    return;
  }


  const addHabitProps = {
    handleChange: handleChange,
    handleSubmit: handleSubmit
  }

  return (
    <div>
      <AddHabit handleChange={handleChange} handleSubmit={handleSubmit} />
    </div>
  )
}
